function handleSelect(o){try{var e=o.target.value;console.log(e),axios.get("/get-books?="+e).then(function(o){var e=o.data;console.log(e),render(document.querySelector(".root"),e)})}catch(o){console.error(o)}}function render(o,e){var n="";e.forEach(function(o){n+='<div class="books">\n  <img ="'+o.img+'" alt="">    \n  </div>'}),o.innerHTML=n}